import React, { useState } from 'react'
import { NavLink } from 'react-router-dom'
import DashboardIcon from '@mui/icons-material/Dashboard';
import PersonIcon from '@mui/icons-material/Person';
import TableChartIcon from '@mui/icons-material/TableChart';
import LoginIcon from '@mui/icons-material/Login';

const Sidebar = () => {
  const [responsive,setresponsive] = useState(false)
  return (
    <div>
      <nav className="navbar">
        
        <div className='border_div'>
        <h2 className='logo'>Creative tim</h2>
        </div>
      
          <ul className={ responsive ? "nav_links_responsive" :"navbar_links "}
          onClick={() => setresponsive(false)}>
            <NavLink to="/"><li><DashboardIcon /> Dashboard</li></NavLink>
            <NavLink to="/useprofile" ><li> <PersonIcon /> use Profile</li></NavLink>
            <NavLink to="/tablelist" ><li><TableChartIcon /> Table List</li></NavLink>
            <NavLink to="/login" ><li><LoginIcon />Log info</li></NavLink>
          </ul>
          <button className='mobile_menu_icon'
          onClick={()=> setresponsive(!responsive)}>
            { responsive ? (
              <i className='fas fa-times'></i>
              ) : (
              <i className='fas fa-bars'></i>
            )}
          </button>
        </nav>
      </div>
  )
}

export default Sidebar
